const Vlogpost = ({
  headerImage,
  title,
  text,
  image,
  firstName,
  lastName,
  date,
}) => {
  return (
    <div>
      <img className='headerVlog' src={headerImage} alt='' />
      <div className='mainVlog'>
        <p className='titleVlog'>{title}</p>
        <div className='textVlog'>{text}</div>
      </div>
      <div className='profileTwo'>
        <div className='miniProfile'>
          <img src={image} alt={lastName} className='img' />
          <div className='nameTwo'>
            {firstName}
            {"  "}
            {lastName}
          </div>
          <div className='date'>{date}</div>
        </div>
      </div>
    </div>
  );
};

export default Vlogpost;
